import React from 'react'
import  {BrowserRouter as Link} from 'react-router-dom';
function Home() {
  return (
  <div>
      <Link to='/about'><h1>About</h1></Link>
      <Link to='/contact'><h1>Contact</h1></Link>
    <h2>Home</h2>
  </div>
  )
}

export default Home
